import animals, { useAnimal } from "./data";

function App() {
    const [cat,dog] = animals
    const {name,sound,feedingRequirement :{food, water}} = cat
    console.log(water)
    const [animalName, setAnimalSound] = useAnimal(cat)
    setAnimalSound()
    return(console.log(animals.name));

}

export default App;
